import React, { useState, useContext } from "react";
import { ThemeContext } from "../../context/Theme";

const ViewNotification = ({ setSelected }) => {
  const [theme, setTheme] = useContext(ThemeContext);
  return (
    <div className="flex flex-col items-start justify-start h-screen p-2 w-full mx-4">
      <button className="absolute top-0 left-0  m-4 px-4 py-2 text-green-500 rounded-lg">
        <i class="fa-solid fa-pen-to-square text-2xl"></i>
      </button>

      <button
        onClick={() => {
          setSelected("Notifications");
        }}
        className="absolute top-0 right-0 m-4 px-4 py-2 rounded-lg"
      >
        <i class="fa-solid fa-circle-chevron-left text-3xl"></i>
      </button>
      <div className="mt-16 text-left">
        <h1 className="text-2xl font-bold">Title</h1>
        <p className="py-4">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit.
        </p>

        <h2 className="text-xl font-bold text-gray-800 ">Message</h2>
        <p className="py-4">
          Pellentesque habitant morbi tristique senectus et netus et malesuada
          fames ac turpis egestas.
        </p>
      </div>
    </div>
  );
};
export default ViewNotification;
